import React, { useEffect } from "react";
import YandexMapConstructor from "react-yandex-maps-constructor";

function MapComponent() {
  const mapWidth = 1000;
  const mapHeight = 1000; // Исправлено название переменной

  return (
    <div>
      <YandexMapConstructor
        width={mapWidth} // Передача переменной для ширины
        height={mapHeight} // Передача переменной для высоты
        script='<script type="text/javascript" charset="utf-8" async src="https://api-maps.yandex.ru/services/constructor/1.0/js/?um=constructor%3Ac46e5e336d5367fa5409fa8e1f528d3da54862723a35eda531bb62aabab498d5&amp;width=500&amp;height=450&amp;lang=ru_RU&amp;scroll=true"></script>'
      />
    </div>
  );
}
export default MapComponent;
